import React from 'react';
import Stories from 'react-insta-stories';

function MCStories() {
  render = () => {
    <div>
      <Stories
        stories={[
          { url: "../../assets/giphy.gif" },
          { url: "../../assets/giphy.gif" }
        ]}
        defaultInterval={1500}
		    width={432}
		    height={768}
      />
    </div>
  };
}

export default MCStories;
